  return (
    <div className="dashboard-container">
      <h2>Welcome to Consent Management Dashboard</h2>

      <div className="dashboard-links">
        <Link to="/agreements">üìù Manage Agreements</Link>
        <Link to="/products">üì¶ View Products</Link>
        <Link to="/orders">üßæ Order Summary</Link>
      </div>
    </div>
  );
};

export default Dashboard;
